import React from 'react'
import { GoogleOutlined, FacebookOutlined } from '@ant-design/icons'

const Login = () => {
    return (
        <div id='login-page'>
            <div id='login-card'>
                <h2>Welcome to the ChatRoom</h2>
                <div className='login-button google'>
                    <GoogleOutlined /> Sign In With Google
                </div>
                <br/><br/>
            </div>
        </div>
    );
}

export default Login
